import React from 'react';
import {Navbar, Nav, NavItem} from 'react-bootstrap';

class Header extends React.Component
{
    render()
    {
      return (
        <Navbar fixedTop>
        <Navbar.Header>
          <Navbar.Brand>
            <a href="/">
              Welcome
            </a>
          </Navbar.Brand>
          <Navbar.Toggle />
        </Navbar.Header>
        <Navbar.Collapse>
          <Nav pullRight>
            <NavItem
              eventKey={1}
              href="/contact.js">
              Contact
            </NavItem>
            <NavItem
              eventKey={2}
              href="/portfolio2.js">
              Portfolio
            </NavItem>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      );
    }
  };

  export default Header;
